        $this->assertEquals(['usd' => Money::USD(1), 'btc' => Money::BTC(6050000000000)], $this->bids()->min());
        $this->assertEquals(['usd' => Money::USD(23650), 'btc' => Money::BTC(172667249)], $this->asks()->min());

